import React from 'react';

const Bio = ({ bio, contact }) => {
	return (
		<div className="bio-container">
			<div className="bio">
				{bio.map((paragraph, i) => {
					return (
						<React.Fragment key={i}>
							<p>{paragraph}</p>
							<br></br>
						</React.Fragment>
					);
				})}
				<br></br>
				<div>
					{contact.map((contact, i) => {
						return <p>{contact}</p>;
					})}
				</div>
			</div>
		</div>
	);
};

export default Bio;
